@Portal do José,  *Ele vive a sua vida de ps¡c○pata e espero que,  após cumpridos os ritos processuaus pertinentes  (muitos!),   seja feito o que é necessário com todo ps¡c○pata perig○so:  **_isolá-lo completamente do convívio social._*

*Armou milícias em todo o território,   aparelhou o estado de acordo com seus interesses,  do Paulão e dos que eles representam,  destruiu grande parte da nação e da população brasileiras,  foi h○m¡c¡da convicto,  praticou e foi apoiador da pior tortura,  da destruição dos diferentes e disseminou a ideia das piores torturas:*  

*CELA DE SEGURANÇA MÁXIMA EM SOLITÁRIA para não ludibriar outros prisioneiros e mesmo carcereiros e agentes de segurança podem serengados!  Extremamente experientes,  ele é capaz de os enganar e angariar para atender os seus interesses.  Obrigada.  Abraço 🌷 🤗🕊🌷*

 @Portal do José,  *Que ótimo!  👏👏👏  Um GR4ND3 PR0B|3M4 são os milhares de MUNICÍPIOS BEM PEQUENOS,  onde nossos meios de comunicação NÃO chegam **_de fato,_**  e são os prefeitos e vereadores locais,  a serviço dos "coroneis"  (que bancaram as suas eleições)  **_que obrigam a população a votar no coiso!_**  🤯  Tem lugares em que o sinal de TV é tirado do ar na hora em que eles bem querem etc. etc. etc.*

*E muitas populações pobres são ameaçadas de que irão cortar a água ou a energia da sua região,  que farão arrastão na escola das crianças  (podem imaginar para o quê? 🤯)  e  assim por diante.*

*Obrigatoriamente,  nós,  brasileiros e brasileiras com ensino médio,  no próximo ano,  seremos obrigados a sair alfabetizando a população porque **_o governo e os donos do dinheiro JAMAIS deixarão o ensino chegar a todos!_**  Abraços 🤗 🌷 🕊*
